import "./Home.css";

import Hero from "./Hero/Hero";
import CategoryCards from "../../CategoryCards/CategoryCards";

const Home = () => {
  return (
    <section className="home">
      <Hero />
      <div className="categories">
        <CategoryCards />
      </div>
    </section>
  );
};
export default Home;
